import LogIn from "./Component/pageJoin/LogIn";
import PageChat from "./Component/pageChat/PageChat";

export const routes = [
    {
        name: "Join Page",
        path: "/",
        exact: true,
        component: <LogIn/>
    },
    {
        name: "Chat Page",
        path: "/chatpage",
        exact: false,
        component: <PageChat/>
    }
]
